from typing import List

def candidate(paren_string: str) -> List[str]:
    cleaned = paren_string.replace(' ', '')
    result = []
    current = []
    open_count = 0
    for char in cleaned:
        if char == '(':
            open_count += 1
        else:
            open_count -= 1
        current.append(char)
        if open_count == 0:
            result.append(''.join(current))
            current = []
    return result
